import axios from "axios";

const fetchUrl = process.env.REACT_APP_PICTURES_MOCK_API;

export const getAllMockImages = async () => {
  console.log("fetchUrl", fetchUrl);
  const resp = await axios.get(fetchUrl);

  if (resp?.status === 200) {
    return resp?.data;
  } else {
    return;
  }
};
